import React from "react";
import { NavLink } from "react-router-dom";
import web from '../src/images/images.jpg';
const Home=()=>{
    return(
        <>
          <div className="container-fluid">
<div className="row">
  <div className="col-10 mx-auto">
<div className="row pt-lg-5">
<div className="col-md-6 pt-lg-5 pt-5  order-2 order-lg-1">
<h1>Grow Your Business with<strong> Octa Solution</strong></h1>
<h2 className="my-5">We are the team of talented Developer making Websites</h2>
<div className="mt-5"><NavLink className="btn-started" to="/">Get Started</NavLink> </div>
</div>

<div className="col-md-6   order-1 order-lg-2">
<div className="header-img"> <img src={web} className="img-fluid animated" alt="header"/></div>
</div>

</div>
  </div>

</div>
   </div>
        </>
    )
}
export default Home;
